import styled from "styled-components";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import "./FontAwesome";
import "../App.css";

const Container = styled.div`
  width: 1140px;
`
const Head = styled.header`
  display: flex;
  position: fixed;
  left: 0;
  top: 0;
  width: 100%;
  padding: 22px 0;
`
const Logo = styled.div`
  width: 30%;
  text-align: center;
`
const MainMenu = styled.div`
  width: 50%;
  ul{
    display: flex;
    list-style: none;
  }
  ul li{
    margin: 0 10px;
  }
`
const Contacts = styled.div`
  width: 20%;
`

const Header = () => {
    return(
        <Head>
            <Container>
                <Logo>
                    <img src='./img/logo.png' alt='CS' />
                </Logo>
                <MainMenu>
                    <ul>
                        <li>Home</li>
                        <li>Pages</li>
                        <li>Features</li>
                        <li>Extensions</li>
                        <li>Tutorials</li>
                        <li>Contact us</li>
                    </ul>
                </MainMenu>
                <Contacts>
                    <FontAwesomeIcon icon={['fab', 'facebook']} />
                    <FontAwesomeIcon icon={['fab', 'twitter']} />
                    <FontAwesomeIcon icon={['fab', 'skype']} />
                    <FontAwesomeIcon icon={['fab', 'instagram']} />
                </Contacts>
            </Container>
        </Head>
    );
}

export default Header;
